import * as WebBrowser from 'expo-web-browser';
import { StyleSheet, TouchableOpacity, Pressable } from 'react-native';
import { Audio } from 'expo-av';
import Colors from '../constants/Colors';
import { MonoText } from './StyledText';
import { Text, View } from './Themed';
import { FontAwesome } from '@expo/vector-icons';
import { useEffect, useState } from 'react';
export default function SearchTextInfo({ data, path }: { data: any, path: string }) {

  const [sound, setSound] = useState({} as any);
  async function playSound(url : any) {
    console.log('Loading Sound',url);
    const sound = new Audio.Sound();
    await sound.loadAsync({ uri: url })
    setSound(sound);
    console.log('Playing Sound'); 
    await sound.playAsync();
  }
  const wordInfo = {
    word: "tin",
    phonetic: "/tɪn/",
    phonetics: [
      {
        text: "/tɪn/",
        audio: "https://api.dictionaryapi.dev/media/pronunciations/en/tin-uk.mp3",
        sourceUrl: "https://commons.wikimedia.org/w/index.php?curid=11037"
      },
      {
        text: "/tɪn/",
        audio: "https://api.dictionaryapi.dev/media/pronunciations/en/tin-us.mp3",
        sourceUrl: "https://commons.wikimedia.org/w/index.php?curid=1197440",
        license: {
          name: "BY-SA 3.0",
          url: "https://creativecommons.org/licenses/by-sa/3.0"
        }
      }
    ],
    meanings: [
      {
        partOfSpeech: "noun",
        definitions: [
          {
            definition: "A malleable, ductile, metallic element, resistant to corrosion, with atomic number 50 and symbol Sn.",
            synonyms: [],
            antonyms: []
          },
          {
            definition: "An airtight container, made of tin or another metal, used to preserve food.",
            synonyms: [],
            antonyms: []
          },
          {
            definition: "A metal pan used for baking, roasting, etc.",
            synonyms: [],
            antonyms: [],
            example: "muffin tin"
          },
          {
            definition: "The bottom part of the front wall, which is \"out\" if a player strikes it with the ball.",
            synonyms: [],
            antonyms: []
          },
          {
            definition: "Money",
            synonyms: [],
            antonyms: []
          },
          {
            definition: "Computer hardware.",
            synonyms: [],
            antonyms: []
          }
        ],
        synonyms: [
          "can",
          "tin can"
        ],
        antonyms: []
      },
      {
        partOfSpeech: "verb",
        definitions: [
          {
            definition: "To place into a tin in order to preserve.",
            synonyms: [],
            antonyms: []
          },
          {
            definition: "To cover with tin.",
            synonyms: [],
            antonyms: []
          },
          {
            definition: "To coat with solder in preparation for soldering.",
            synonyms: [],
            antonyms: []
          }
        ],
        synonyms: [],
        antonyms: []
      },
      {
        partOfSpeech: "adjective",
        definitions: [
          {
            definition: "Made of tin.",
            synonyms: [],
            antonyms: []
          },
          {
            definition: "Made of galvanised iron or built of corrugated iron.",
            synonyms: [],
            antonyms: []
          }
        ],
        synonyms: [
          "tinnen"
        ],
        antonyms: []
      }
    ],
    license: {
      name: "CC BY-SA 3.0",
      url: "https://creativecommons.org/licenses/by-sa/3.0"
    },
    sourceUrls: [
      "https://en.wiktionary.org/wiki/tin"
    ]
  };
  const meanings = wordInfo.meanings;
  console.log('word info', wordInfo);
  return (
    <View>
      <View style={styles.getStartedContainer}>
        <Text
          style={styles.getStartedText}
          lightColor="rgba(0,0,0,0.8)"
          darkColor="rgba(255,255,255,0.8)">
          <b>Pronunciation</b> {wordInfo.phonetic}
        </Text>
        {wordInfo.phonetics && wordInfo.phonetics.map((value: any, key: any) => {
          console.log(value, key);
          return (
            <div style={{ display: "flex" }}>
              <Text
                style={styles.getStartedText}
                lightColor="rgba(0,0,0,0.8)"
                darkColor="rgba(255,255,255,0.8)">
                <i>{key == 0 ? "(enUK)" : "(enUS)"}</i> : {value.text}
              </Text>
              <Pressable
              onPress={async () => await playSound(value.audio)}
              >

                <FontAwesome
                  name="file-audio-o"
                  size={18}
                  style={{ marginLeft: 15 }}
                  color="#FFFFFF"
                />
              </Pressable>
            </div>
          )
        })}
        <View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />
        {meanings && meanings.map((value: any, key: any) => {
          const definitions = value.definitions || [];
            return (
              <div>
              <Text
                style={styles.infoText}
              lightColor="rgba(0,0,0,0.8)"
              darkColor="rgba(255,255,255,0.8)">
              {value.partOfSpeech}
            </Text>
            {definitions && definitions.map((def: any, key: any) =>{
                return (
                  <Text
                  style={styles.getStartedText}
                  lightColor="rgba(0,0,0,0.8)"
                  darkColor="rgba(255,255,255,0.8)">
                  {def.definition}
                </Text>
                )
            })};
           </div>
            )

        })}

      </View>
    </View>
  );
}

function handleHelpPress() {
  WebBrowser.openBrowserAsync(
    'https://docs.expo.io/get-started/create-a-new-app/#opening-the-app-on-your-phonetablet'
  );
}

const styles = StyleSheet.create({
  getStartedContainer: {
    marginHorizontal: 50,
  },
  separator: {
    marginVertical: 10,
    height: 1,
    width: '80vw',
  },
  homeScreenFilename: {
    marginVertical: 7,
  },
  codeHighlightContainer: {
    borderRadius: 3,
    paddingHorizontal: 4,
  },
  getStartedText: {
    fontSize: 13,
    marginBottom: 10,
    lineHeight: 15,
  },
  infoText:{
    fontSize: 18,
    fontWeight: 'bold',
    color: '#FFFF00'
  },
  helpContainer: {
    marginTop: 15,
    marginHorizontal: 20,
  },
  helpLink: {
    paddingVertical: 15,
  },
  helpLinkText: {
  },
});
